const Navbar = () => {

    const navBarButton = [ 'MaluCommerce', 'Products', 'About Us', 'Contact Us' ];
    console.log('holaakjkj')

  return (
    <>
    <Box style={{display:'flex', flexDirection:'row', height:60}}>
    {
    navBarButton.map( (m, i) => { 
        return <Buttons value={m} key={i}/>
    })}
    <CartWidget/>
    </Box>
    </>
  )
}

export default Navbar
